(1, 'Maratua Paradise Resort', 'resort', 'Tipe: Resort | Lokasi: Pulau Maratua', 'Maratua Paradise Resort menawarkan pengalaman menginap yang tak terlupakan dengan villa-villa mewah yang dibangun di atas air (water villa). Setiap kamar memiliki akses langsung ke laut, memungkinkan Anda untuk berenang dan snorkeling kapan saja.', 'Pulau Maratua', 'uploads/akomodasi/6945390478812_1766144260.png', 'Mulai dari Rp 1.500.000 / malam', 'AC, WiFi, Restoran, Antar-Jemput Bandara, Dive Center', 'Water Villa, Beach Villa', '(0551) 123-4567', 'reservation@maratuaparadise.com', 'www.maratuaparadise.com', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3986.7820846850377!2d118.5639302747402!3d2.2354056977448797!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3212aeb18c81789d%3A0x837a7025dcb6659b!2sMaratua%20Paradise%20Resort!5e0!3m2!1sid!2sid!4v1766144191421!5m2!1sid!2sid', 'aktif', '2025-12-09 09:14:13', '2025-12-19 11:37:40'),
(2, 'Derawan Indah Homestay', 'homestay', 'Tipe: Homestay | Lokasi: Pulau Derawan', 'Homestay yang nyaman dan ramah di tengah Pulau Derawan dengan akses mudah ke pantai dan spot snorkeling terbaik.', 'Pulau Derawan', 'uploads/akomodasi/69453a2e9f346_1766144558.png', 'Mulai dari Rp 250.000 / malam', 'WiFi, AC, Fan, Kamar Mandi Dalam, Breakfast', 'Standard Room, Family Room', '(0551) 234-5678', 'info@derawanhomestay.com', 'www.derawanhomestay.com', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3986.9880440220863!2d117.49480587473992!3d2.158247097822569!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x320df5a67ae977a1%3A0xd1341da52127082a!2sHotel%20Derawan%20Indah!5e0!3m2!1sid!2sid!4v1766144489293!5m2!1sid!2sid', 'aktif', '2025-12-09 09:14:13', '2025-12-19 11:42:38');
