INSERT INTO `destinasi` (`id`, `nama`, `deskripsi`, `deskripsi_lengkap`, `lokasi`, `gambar_utama`, `tiket_masuk`, `fasilitas`, `jam_buka`, `dos`, `donts`, `maps_embed`, `status`, `created_at`, `updated_at`) VALUES
(1, 'Pulau Derawan', 'Nikmati keindahan pantai pasir putih dan biota laut yang memukau.', 'Pulau Derawan merupakan salah satu destinasi wisata bahari terbaik di Indonesia dengan keindahan alam bawah laut yang menakjubkan.', 'Kepulauan Derawan, Berau', 'uploads/destinasi/69452b0359a27_1766140675.png', 'Rp 10.000 / orang', 'Toilet, Warung Makan, Sewa Alat Snorkeling', '24 Jam', 'Menjaga kebersihan pantai|Menggunakan sunblock ramah lingkungan|Menghormati habitat penyu', 'Menginjak terumbu karang|Memberi makan ikan sembarangan|Membuang sampah di laut', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d510311.77235655725!2d117.93920316729236!3d2.2248375588231206!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3212abcef5b94afb%3A0xe4cf7029473436a9!2sKepulauan%20Derawan!5e0!3m2!1sid!2sid!4v1766140513183!5m2!1sid!2sid', 'aktif', '2025-12-09 09:14:13', '2025-12-29 17:55:23'),
(2, 'Danau Labuan Cermin', 'Danau dua rasa yang jernih dengan lapisan air tawar dan air asin.', 'Danau Labuan Cermin adalah sebuah fenomena alam unik yang terletak di Desa Labuan Kelambu, Kecamatan Biduk-Biduk. Disebut sebagai danau dua rasa karena memiliki lapisan air tawar di permukaan dan air asin di dasarnya.', 'Biduk-Biduk, Berau', 'uploads/destinasi/69452c1a8c73a_1766140954.png', 'Rp 25.000 / orang', 'Toilet, Ruang Ganti, Warung Makan, Sewa Pelampung &amp;amp; Perahu', 'Setiap Hari, 08:00 - 17:00 WITA', 'Menggunakan pelampung saat berenang|Menjaga kebersihan danau|Membawa kamera bawah air|Menghormati adat lokal', 'Menggunakan sabun di danau|Merusak terumbu karang|Membuat keributan|Melompat dari tebing curam', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d1020966.9643115869!2d117.2682090625!3d1.6558797765974882!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x32734cb76f07da33%3A0x5e898623450bccae!2sLabuan%20Cermin!5e0!3m2!1sid!2sid!4v1766143923931!5m2!1sid!2sid', 'aktif', '2025-12-09 09:14:13', '2025-12-19 11:32:11'),
(3, 'Goa Haji Mangku', 'Tantang adrenalin Anda dengan melompat ke kolam air asin berwarna biru toska.', 'Goa Haji Mangku menawarkan pengalaman unik dengan kolam alami berwarna biru toska yang dikelilingi stalaktit dan stalagmit.', 'Berau', 'uploads/destinasi/69452d192ff63_1766141209.png', 'Rp 15.000 / orang', 'Pemandu Wisata, Sewa Pelampung, Area Parkir', '08:00 - 16:00 WITA', 'Menggunakan pemandu lokal|Memakai pelampung|Berhati-hati saat melompat', 'Melompat tanpa persiapan|Merusak formasi goa|Berenang sendirian', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d1020966.9643115869!2d117.2682090625!3d1.6558797765974882!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3212aa5be5bbaa57%3A0xe49ba8e52f98a645!2sWisata%20danau%20hj%20mangku!5e0!3m2!1sid!2sid!4v1766143901038!5m2!1sid!2sid', 'aktif', '2025-12-09 09:14:13', '2025-12-19 11:31:54'),
(4, 'Pulau Sangalaki', 'Pusat konservasi penyu dan spot menyelam yang menakjubkan.', 'Pulau Sangalaki dikenal sebagai tempat konservasi penyu hijau dan penyu sisik. Pulau ini juga menjadi surga bagi penyelam dengan keindahan terumbu karang yang luar biasa.', 'Kepulauan Derawan, Berau', 'uploads/destinasi/69452eed6b511_1766141677.png', 'Rp 20.000 / orang', 'Pusat Konservasi Penyu, Dive Center, Homestay', '24 Jam', 'Ikut program konservasi|Diving dengan pemandu|Mengikuti aturan konservasi', 'Mengganggu penyu bertelur|Mengambil telur penyu|Menyentuh terumbu karang', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d1020966.9643115869!2d117.2682090625!3d1.6558797765974882!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x320d5bf1261b1473%3A0x95a5123e601cefb7!2sPulau%20Sangalaki!5e0!3m2!1sid!2sid!4v1766143943456!5m2!1sid!2sid', 'aktif', '2025-12-09 09:14:13', '2025-12-19 11:32:37'),
(5, 'Pulau Maratua', 'Resort eksotis di atas air dan laguna tersembunyi yang indah.', 'Pulau Maratua menawarkan pengalaman menginap di atas air dengan pemandangan laut yang spektakuler. Pulau ini memiliki laguna tersembunyi yang sangat indah.', 'Kepulauan Derawan, Berau', 'uploads/destinasi/69452fa2a45a0_1766141858.png', 'Rp 15.000 / orang', 'Water Villa, Dive Center, Restaurant, Spa', '24 Jam', 'Snorkeling di laguna|Diving dengan instruktur|Menikmati sunset', 'Merusak ekosistem laut|Berenang di area berbahaya|Memberi makan ikan', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d1020966.9643115869!2d117.2682090625!3d1.6558797765974882!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3212ac7490c7038d%3A0x9b789f0629d46dd0!2sPulau%20Maratua!5e0!3m2!1sid!2sid!4v1766143967293!5m2!1sid!2sid', 'aktif', '2025-12-09 09:14:13', '2025-12-19 11:32:59'),
(6, 'Air Terjun Tembalang', 'Air terjun bertingkat dengan kolam alami yang menyegarkan.', 'Air Terjun Tembalang memiliki beberapa tingkat dengan kolam-kolam alami yang jernih dan segar. Tempat yang sempurna untuk berenang dan bersantai.', 'Berau', 'uploads/destinasi/694532c053c90_1766142656.png', 'Rp 5.000 / orang', 'Area Parkir, Warung, Gazebo', '07:00 - 18:00 WITA', 'Berenang di kolam aman|Membawa bekal makanan|Menjaga kebersihan', 'Berenang saat hujan deras|Melompat dari ketinggian|Meninggalkan sampah', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d1020652.4000884186!2d115.79454957812503!3d2.1827440000000022!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x320e03da265816d7%3A0xe74604313159ec45!2sAir%20Terjun%20Tembalang!5e0!3m2!1sid!2sid!4v1766144000425!5m2!1sid!2sid', 'aktif', '2025-12-09 09:14:13', '2025-12-19 11:33:33'),
(7, 'Pulau Kakaban', 'Rumah bagi ubur-ubur tanpa sengat yang purba.', 'Pulau ini memiliki danau air payau di tengahnya yang terisolasi dari laut selama ribuan tahun. Di sini hidup empat spesies ubur-ubur (salah satunya Golden Jellyfish) yang kehilangan kemampuan menyengat karena tidak adanya predator. Pengunjung bisa berenang bersama ribuan ubur-ubur ini.', 'Kepulauan Derawan, Berau', 'uploads/destinasi/694533517a8f2_1766142801.png', 'Rp20.000 - Rp50.000 per orang.', 'Dermaga, tangga akses, toilet.', '08.00  16.00 WITA', 'Bilas tubuh di laut/dermaga sebelum masuk ke danau agar bebas dari bahan kimia | Berenang dengan gerakan tenang dan perlahan | Masuk ke air lewat tangga yang disediakan agar tidak merusak lumpur di pinggir danau', 'Menggunakan kaki katak (fin) saat berenang (bisa menyabet dan merobek tubuh ubur-ubur) | Mengangkat ubur-ubur keluar dari permukaan air (mereka butuh air untuk hidup) | Melompat keras atau bomb jump ke dalam air', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d1020675.1599134256!2d117.30778367812498!3d2.148961200000003!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x320d56ff5c3dd195%3A0x41738ad59819fc00!2sPulau%20Kakaban!5e0!3m2!1sid!2sid!4v1766144023022!5m2!1sid!2sid', 'aktif', '2025-12-16 04:28:55', '2025-12-19 11:33:57'),
(8, 'Perairan Talisayan', 'Spot berenang bersama Hiu Paus raksasa.', 'Hiu paus sering muncul di sekitar bagan nelayan untuk mencari ikan-ikan kecil. Pengunjung bisa snorkeling di dekatnya.', 'Kecamatan Talisayan.', 'uploads/destinasi/6945346160be9_1766143073.png', 'Rp500rb - Rp1jt per rombongan', 'Perahu wisata.', '05.00  08.00 WITA', 'Berangkat subuh agar sampai lokasi saat Hiu Paus masih aktif makan | Masuk ke air dengan perlahan tanpa cipratan air berlebihan | Patuhi instruksi kapten kapal atau pemandu lokal', 'Menyentuh bagian tubuh mana pun dari Hiu Paus (kulit mereka sensitif bakteri manusia) | Berada tepat di depan mulut atau di belakang ekor Hiu Paus (berbahaya) | Menggunakan flash kamera di dalam air', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d63813.43892695053!2d118.12651853667171!3d1.5597988969383818!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x320ce2718ba2bd59%3A0xd848dcc2d0cd218b!2sHiu%20Paus%20Tutul%20-%20Talisayan!5e0!3m2!1sid!2sid!4v1766143015503!5m2!1sid!2sid', 'aktif', '2025-12-16 04:34:09', '2025-12-19 11:17:53'),
(9, 'Pulau Kaniungan', 'Pulau sepi dengan pesona pohon kelapa miring.', 'Pulau tenang yang cocok untuk menepi dari keramaian. Pasir putihnya lembut dan airnya dangkal, aman untuk anak-anak.', 'Kecamatan Biduk-Biduk, Berau', 'uploads/destinasi/69453582f23e5_1766143362.png', 'Gratis (hanya biaya kapal)', 'Spot foto, area camping, homestay sederhana.', '24 Jam', 'Membawa bekal makanan dan minuman sendiri (warung sangat terbatas) | Berfoto di pohon kelapa yang miring ke laut (ikon pulau ini) | Membawa hammock untuk bersantai di antara pohon kelapa', 'Menebang atau merusak dahan pohon kelapa demi properti foto | Meninggalkan sampah plastik atau botol minuman di pasir putih | Membuat api unggun terlalu dekat dengan vegetasi kering.', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d7978.120731374016!2d118.83662189025507!3d1.1168363954898148!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x327357461ec944d5%3A0x93c7d4ca76ee8226!2sPulau%20Kaniungan-besar!5e0!3m2!1sid!2sid!4v1766143316212!5m2!1sid!2sid', 'aktif', '2025-12-16 04:36:53', '2025-12-19 11:22:42'),
(10, 'Air Terjun Bidadari', 'Air terjun tersembunyi yang jatuh ke laut.', 'Membutuhkan sedikit petualangan untuk sampai ke sini. Pemandangannya unik karena air tawar langsung bertemu air laut.', 'Desa Teluk Sumbang, Biduk-Biduk.', 'uploads/destinasi/69453671b83a7_1766143601.png', 'Gratis (akses via kapal berbayar)', 'Alami (hampir tidak ada fasilitas buatan)', '24 Jam', 'Gunakan sepatu atau sandal gunung yang anti selip untuk trekking | Membawa persediaan air minum yang cukup karena lokasi terpencil | Gunakan jasa pemandu lokal atau warga setempat agar tidak tersesat', 'Memanjat dinding air terjun (sangat licin dan berlumut) | Datang terlalu sore (perjalanan pulang kapal berisiko jika gelap) | Mencoret-coret bebatuan di sekitar air terjun', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3989.1720017013395!2d118.83106249633497!3d1.0313124824650852!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3274a90026a148c7%3A0x96c03f528ef1e0ae!2sAIR%20TERJUN%20BIDADARI!5e0!3m2!1sid!2sid!4v1766143586350!5m2!1sid!2sid', 'aktif', '2025-12-16 04:39:39', '2025-12-19 11:26:41');
INSERT INTO `events` (`id`, `nama`, `deskripsi`, `deskripsi_lengkap`, `tanggal`, `bulan`, `hari`, `lokasi`, `gambar_utama`, `jam_pelaksanaan`, `penyelenggara`, `kontak`, `maps_embed`, `tips`, `status`, `created_at`, `updated_at`) VALUES
(3, 'Pesta Rakyat Tahun Baru', 'Perayaan malam tahun baru dengan kembang api dan hiburan musik di Lapangan Pemuda.', 'Pesta Rakyat Tahun Baru adalah perayaan pergantian tahun terbesar di Berau. Acara ini dimeriahkan dengan panggung hiburan yang menampilkan artis lokal dan nasional, bazaar kuliner dan kerajinan, serta puncak acara pelepasan lampion dan kembang api spektakuler tepat saat pergantian tahun. Ribuan warga dan wisatawan berkumpul untuk menyambut tahun baru dengan penuh suka cita.', '2025-12-31', 'DES', 31, 'Lapangan Pemuda', 'uploads/events/69453c6c4b4ee_1766145132.png', '19:00 - 01:00 WITA', 'Pemkab Berau', '0541-1234567', '', 'Datang lebih awal karena akan sangat ramai|Parkir kendaraan di tempat yang aman|Jaga barang berharga Anda|Siapkan jaket karena udara malam cukup dingin', 'aktif', '2025-12-09 09:14:13', '2025-12-19 11:52:12');
